import React, { Component } from "react";
import EachNote from "./components/eachNote/note";
class App extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return <EachNote title="PDF Title" date="6/11/2019" nodownload="14" />;
  }
}

export default App;
